class EditorConsole {
  constructor(model, editorTabs, editor) {
    Module._set_result_callback(
      Module.addFunction(this.upload.bind(this), "viiii")
    );

    this.model = model;
    this.editor = editor;
    this.editorTabs = editorTabs;
    this.stderr = "";
    this.running = false;

    this.consoleDragger = document.getElementById("dragger");
    this.consoleLeftPanel = document.getElementById("editor-wrapper");
    this.consoleRightPanel = document.getElementById("console");
    this.consoleStatus = document.getElementById("console-status");
    this.consoleCanvas = document.getElementById("console-canvas");
    this.consoleOutput = document.getElementById("console-output");
    this.consoleButton = document.getElementById("console-action");
    this.consoleButtonText = document.getElementById("console-action-text");
    this.consoleButtonStartIcon = document.getElementById(
      "console-action-start-icon"
    );
    this.consoleButtonStopIcon = document.getElementById(
      "console-action-stop-icon"
    );

    this.consoleButton.onclick = () => this.onClick();
    this.draggingDelta = 0;

    this.consoleDragger.addEventListener("pointerdown", (event) => {
      this.draggingDelta = event.clientX - event.target.offsetLeft;
      this.consoleDragger.setPointerCapture(event.pointerId);
    });

    this.consoleDragger.addEventListener("pointermove", (event) => {
      if (!this.consoleDragger.hasPointerCapture(event.pointerId))
        return;

      const leftRatio = (event.clientX - this.draggingDelta) / document.body.clientWidth * 100;
      const rightRatio = (event.clientX - this.draggingDelta + this.consoleDragger.clientWidth) / document.body.clientWidth * 100;

      if (leftRatio < 10 || rightRatio > 90)
        return;

      this.consoleLeftPanel.style.width = leftRatio + "%";
      this.consoleRightPanel.style.width = (100 - rightRatio) + "%";
    });

    this.consoleDragger.addEventListener("pointerup", () => {
      this.consoleDragger.releasePointerCapture(event.pointerId);
    });
  }

  upload(size, data, sourceMapSize, sourceMap) {
    this.clear();

    if (!size) {
      this.error("Internal compiler error:\n\n" + this.stderr);
      this.stderr = "";

      return;
    }

    const bytecode = Module.HEAPU8.subarray(data, data + size);
    const debug = Module.HEAPU8.subarray(sourceMap, sourceMap + sourceMapSize);
    const offscreen = canvas.transferControlToOffscreen();

    this.running = true;

    this.consoleButtonText.innerText = "Stop";
    this.consoleButtonStopIcon.style.display = "";
    this.consoleButtonStartIcon.style.display = "none";

    this.executionStartTime = performance.now();
    this.executionTime = 0;

    if (this.worker) {
      this.worker.terminate();
    }

    this.worker = new Worker(this.editor.blobUrl);
    this.worker.onerror = this.onWorkerError.bind(this);
    this.worker.onmessage = this.onWorkerMessage.bind(this);
    this.worker.postMessage(
      { type: "start", bytecode, debug, canvas: offscreen },
      [offscreen]
    );

    this.onStart();

    Module._free(data);
    Module._free(sourceMap);
  }

  start() {
    if (this.editor.errors.length) {
      let buffer = "";

      for (const error of this.editor.errors) {
        if (error.startLineNumber && error.startColumn)
          buffer += `<a onclick='Module.editor.goto(${error.startLineNumber}, ${error.startColumn})' href='#'>` +
            this.editorTabs.getTabName() +
            ".cy:" +
            error.startLineNumber +
            ":" + error.startColumn + "</a>: ";

        buffer +=
          "<span style='color:red'>error: </span>" +
          error.message.replaceAll("<", "&lt;").replaceAll(">", "&gt;") +
          "\n";
      }

      this.clear();
      this.print(buffer);

      return;
    }

    if (this.running) {
      throw new Error("worker is already running");
    }

    try {
      Module._run(this.editor.getText(), true);
    }
    catch (error) {
      this.clear();
      this.error("Internal compiler error:\n\n" + this.stderr + error.stack);
      this.stderr = "";

      console.error(error);
    }
  }

  stop(terminate) {
    if (!this.running) {
      return;
    }

    this.running = false;

    this.consoleButtonText.innerText = "Run";
    this.consoleButtonStopIcon.style.display = "none";
    this.consoleButtonStartIcon.style.display = "";

    if (terminate) {
      this.worker.terminate();
      this.worker = undefined;
    }

    this.executionTime = (performance.now() - this.executionStartTime) / 1000;

    this.setStatus(
      `Press "Run" to start a program. <br><span>(Program ran for ${this.executionTime.toFixed(
        3
      )} seconds.)</span>`
    );
  }

  clear() {
    this.consoleCanvas.innerHTML = `<canvas id="canvas" width="0" height="0"></canvas>`;
    this.consoleOutput.innerHTML = "";

    const canvas = document.getElementById("canvas");
    canvas.onpointermove = (event) => {
      if (this.worker) {
        this.worker.postMessage({
          type: "mousemove",
          x: event.offsetX,
          y: event.offsetY,
          buttons: event.buttons,
        });
      }
    };

    canvas.onpointerup = (event) => {
      if (this.worker) {
        this.worker.postMessage({
          type: "mouseup",
          x: event.offsetX,
          y: event.offsetY,
        });
      }
    };

    canvas.onpointerdown = (event) => {
      if (this.worker) {
        this.worker.postMessage({
          type: "mousedown",
          x: event.offsetX,
          y: event.offsetY,
        });
      }
    };

    window.onkeydown = (event) => {
      if (this.worker) {
        this.worker.postMessage({
          type: "keydown",
          key: event.keyCode,
        });
      }
    };

    window.onkeyup = (event) => {
      if (this.worker) {
        this.worker.postMessage({
          type: "keyup",
          key: event.keyCode,
        });
      }
    };
  }

  error(text) {
    this.print("<span style='color:red'>error: </span>" + text + "\n");
  }

  print(text, isTextOnly) {
    const shouldScrollToBottom =
      this.consoleOutput.scrollTop +
      this.consoleOutput.clientHeight -
      this.consoleOutput.scrollHeight >=
      -5;

    if (isTextOnly) this.consoleOutput.textContent += text;
    else this.consoleOutput.innerHTML += text;

    if (shouldScrollToBottom) {
      this.consoleOutput.scrollTo(0, this.consoleOutput.scrollHeight);
    }
  }

  onClick() {
    if (!this.running) {
      this.start();
    } else {
      this.stop(true);
      this.print("Program was terminated.\n");
    }
  }

  onStart() {
    this.setStatus(`Program is running...`);
  }

  onWorkerError(event) {
    this.print("Program crashed unexpectedly due to an error:\n\n");
    this.error(event.message);
    this.stop(true);
  }

  onWorkerMessage(event) {
    const data = event.data;

    switch (data.type) {
      case "stop": {
        this.stop();
        break;
      }

      case "print": {
        this.print(data.text + "\n", true);
        break;
      }

      case "error": {
        this.print("Program crashed unexpectedly due to an error:\n\n");
        this.error(data.message);
        this.stop();

        break;
      }
    }
  }

  setStatus(status) {
    this.consoleStatus.innerHTML = status;
  }
}

